

CREATE DATABASE lms_db;

\c lms_db;

create sequence _token_seq start with 1 increment by 50;

create table _author (
author_create_user_id bigint,
author_id bigserial not null,
author_name varchar(255),
primary key (author_id)
);

create table _book (
book_available boolean,
book_date_created date,
book_year_publication integer,
book_create_user_id bigint,
book_id bigserial not null,
book_description varchar(255),
book_name varchar(255),
primary key (book_id));

create table _book_feedback (
book_feedback_id serial not null,
book_feedback_rating smallint check (book_feedback_rating between 0 and 4),
book_feedback_status smallint check (book_feedback_status between 0 and 4),
book_feedback_book_register_id bigint unique,
book_feedback_description varchar(255),
primary key (book_feedback_id));

create table _genre (
genre_id bigserial not null,
genre_name varchar(255),
primary key (genre_id));

create table _register_book_confirm (
valid boolean,
last_update timestamp(6),
register_id bigserial not null,
register_reserve_id bigint,
primary key (register_id));

create table _register_book_reserve (
register_book_date_end date,
register_book_date_start date,
valid boolean,
last_update timestamp(6),
register_book_id bigint,
register_id bigserial not null,
register_user_id bigint,
primary key (register_id));

create table _register_book_return (
valid boolean,
last_update timestamp(6),
register_id bigserial not null,
register_reserve_id bigint,
primary key (register_id));

create table _role (
role_id serial not null,
role_name varchar(255),
primary key (role_id));

create table _token (
expired boolean not null,
revoked boolean not null,
id bigint not null,
token_user_id bigint,
token varchar(255) unique,
primary key (id));

create table _user (
user_id bigserial not null,
user_email varchar(255),
user_name varchar(255),
user_password varchar(255),
primary key (user_id));

create table authors_books (
author_id bigint not null,
book_id bigint not null,
primary key (author_id, book_id));

create table books_genres (
book_id bigint not null,
genre_id bigint not null,
primary key (book_id, genre_id));

create table genre_books (
book_id bigint not null,
genre_id bigint not null,
primary key (book_id, genre_id));

create table users_roles (
role_id integer not null,
user_id bigint not null);

